import React, { useEffect, useState } from 'react';
import { useAuth } from '../context/AuthContext';
import DashboardLayout from '../layouts/DashboardLayout';
import StatsCard from '../components/dashboard/StatsCard';
import RiskGauge from '../components/dashboard/RiskGauge';
import PredictionHistory from '../components/dashboard/PredictionHistory';
import ActivityTimeline from '../components/dashboard/ActivityTimeline';
import DashboardHeader from '../components/dashboard/DashboardHeader';
import { getDashboardData } from '../services/dashboard';
import LoadingSpinner from '../components/common/LoadingSpinner';

const Dashboard = () => {
  const { user } = useAuth();
  const [dashboardData, setDashboardData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [selectedStatsDetail, setSelectedStatsDetail] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        console.log('ðŸ“Š Fetching dashboard data via service...');
        const data = await getDashboardData(user.role);
        console.log("ðŸ“Š dashboardData:", data);
        setDashboardData(data);
      } catch (error) {
        console.error('Failed to fetch dashboard data:', {
          message: error.message,
          status: error.response?.status,
          data: error.response?.data,
          url: error.config?.url
        });
      } finally {
        setLoading(false);
      }
    };

    if (user?.role) {
      fetchData();
    }
  }, [user.role]);

  if (loading || !dashboardData) {
    return (
      <DashboardLayout>
        <div className="flex justify-center items-center h-64">
          <LoadingSpinner />
        </div>
      </DashboardLayout>
    );
  }

  const renderStatsModalContent = () => {
    if (!selectedStatsDetail) return null;

    switch (selectedStatsDetail) {
      case 'totalPredictions':
        return (
          <>
            <h3 className="text-lg font-semibold mb-4">Total Predictions Details</h3>
            <p>Total number of predictions made: <strong>{dashboardData.statistics.total_predictions}</strong></p>
          </>
        );
      case 'recentActivity':
        return (
          <>
            <h3 className="text-lg font-semibold mb-4">Recent Activity Details</h3>
            <p>Predictions in last 7 days: <strong>{dashboardData.statistics.recent_predictions || 0}</strong></p>
          </>
        );
      case 'totalPatients':
        return (
          <>
            <h3 className="text-lg font-semibold mb-4">Total Patients Details</h3>
            <p>Patients under your care: <strong>{dashboardData.statistics.total_patients || 0}</strong></p>
          </>
        );
      case 'highRisk':
        return (
          <>
            <h3 className="text-lg font-semibold mb-4">High Risk Details</h3>
            <p>High-risk cases: <strong>{dashboardData.statistics.risk_distribution?.High || 0}</strong></p>
            <p>Moderate-risk cases: <strong>{dashboardData.statistics.risk_distribution?.Moderate || 0}</strong></p>
            <p>Low-risk cases: <strong>{dashboardData.statistics.risk_distribution?.Low || 0}</strong></p>
          </>
        );
      default:
        return null;
    }
  };

  // Calculate risk distribution for patient
  const patientRiskDistribution = dashboardData.statistics.risk_distribution || {};
  const totalRiskCases = Object.values(patientRiskDistribution).reduce((a, b) => a + b, 0);
  const highRiskPercentage = totalRiskCases > 0 
    ? Math.round((patientRiskDistribution.High || 0) / totalRiskCases * 100) 
    : 0;

  return (
    <DashboardLayout>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8 w-full">
        <DashboardHeader />

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-4 md:gap-6 mb-8">
          <StatsCard
            title="Total Predictions"
            value={dashboardData.statistics.total_predictions || 0}
            trend={12}
            icon="chartBar"
            onViewDetails={() => setSelectedStatsDetail('totalPredictions')}
          />
          
          <StatsCard
            title={user?.role === 'doctor' ? "Recent Activity" : "Recent Predictions"}
            value={
              user?.role === 'doctor' 
                ? dashboardData.statistics.recent_activity || 0 
                : dashboardData.statistics.recent_predictions || 0
            }
            trend={5}
            icon="clock"
            onViewDetails={() => setSelectedStatsDetail('recentActivity')}
          />
          
          {user?.role === 'doctor' ? (
            <StatsCard
              title="Total Patients"
              value={dashboardData.statistics.total_patients || 0}
              trend={3}
              icon="userGroup"
              onViewDetails={() => setSelectedStatsDetail('totalPatients')}
            />
          ) : (
            <StatsCard
              title="High Risk %"
              value={highRiskPercentage}
              trend={-2}
              icon="exclamation"
              isRisk={true}
              valueSuffix="%"
            />
          )}
          
          <StatsCard
            title="High Risk"
            value={dashboardData.statistics.risk_distribution?.High || 0}
            trend={8}
            icon="shieldExclamation"
            isRisk={true}
            onViewDetails={() => setSelectedStatsDetail('highRisk')}
          />
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-4 md:gap-6 mb-8">
          <div className="lg:col-span-1 bg-white rounded-xl shadow-md p-4 md:p-6">
            <h2 className="text-lg md:text-xl font-semibold text-gray-800 mb-4">Your CVD Risk Level</h2>
            <RiskGauge
              value={dashboardData.latest_prediction?.risk_percentage || 0}
              category={dashboardData.latest_prediction?.risk_category || 'Low'}
            />
            <div className="mt-4 text-sm text-gray-600">
              {dashboardData.latest_prediction?.risk_category === 'High' ? (
                <p>Consult with your doctor immediately about cardiovascular health strategies.</p>
              ) : dashboardData.latest_prediction?.risk_category === 'Moderate' ? (
                <p>Consider lifestyle changes to reduce your cardiovascular risk.</p>
              ) : (
                <p>Maintain your healthy lifestyle to keep your risk low.</p>
              )}
            </div>
          </div>

          <div className="lg:col-span-2 bg-white rounded-xl shadow-md p-4 md:p-6">
            <h2 className="text-lg md:text-xl font-semibold text-gray-800 mb-4">Prediction History</h2>
            <PredictionHistory predictions={dashboardData.recent_predictions || []} />
          </div>
        </div>

        <div className="bg-white rounded-xl shadow-md p-4 md:p-6">
          <h2 className="text-lg md:text-xl font-semibold text-gray-800 mb-4">Recent Activity</h2>
          <ActivityTimeline activities={dashboardData.recent_activities || []} />
        </div>

        {/* Modal for stats cards details */}
        {selectedStatsDetail && (
          <div
            className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center z-50 p-4"
            onClick={() => setSelectedStatsDetail(null)}
          >
            <div
              className="bg-white rounded-lg shadow-lg max-w-md w-full p-6"
              onClick={(e) => e.stopPropagation()}
            >
              {renderStatsModalContent()}
              <div className="mt-6 text-center">
                <button
                  onClick={() => setSelectedStatsDetail(null)}
                  className="px-4 py-2 bg-primary-600 text-white rounded hover:bg-primary-700 transition-colors"
                >
                  Close
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </DashboardLayout>
  );
};

export default Dashboard;
